"Claim.Item": {
    /*A provider issued list of services and products provided, or to be provided, to a patient which is provided to an insurer for payment recovery.
     */
  "name": "Claim.Item",
  "base": "BackboneElement", 
  "attrs": [
  ],
  "elems": [
    { 
    /*A service line number.
     */  "name": "sequence", 
    
      "min": "1", 
      "max": "1", 
      "type": "positiveInt",
      "isPrimitive": true }, 
    { 
    /*CareTeam applicable for this service or product line.
     */  "name": "careTeamSequence", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "positiveInt",
      "isPrimitive": true }, 
    { 
    /*Diagnosis applicable for this service or product line.
     */  "name": "diagnosisSequence", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "positiveInt",
      "isPrimitive": true }, 
    { 
    /*Procedures applicable for this service or product line.
     */  "name": "procedureSequence", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "positiveInt",
      "isPrimitive": true }, 
    { 
    /*Exceptions, special conditions and supporting information pplicable for this service or product line.
     */  "name": "informationSequence", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "positiveInt",
      "isPrimitive": true }, 
    { 
    /*The type of reveneu or cost center providing the product and/or service.
     */  "name": "revenue", 
    
      "min": "0", 
      "max": "1", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    { 
    /*Health Care Service Type Codes  to identify the classification of service or benefits.
     */  "name": "category", 
    
      "min": "0", 
      "max": "1", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    { 
    /*If this is an actual service or product line, ie. not a Group, then use code to indicate the Professional Service or Product supplied (eg. CTP, HCPCS,USCLS,ICD10, NCPDP,DIN,RXNorm,ACHI,CCI). If a grouping item then use a group code to indicate the type of thing being grouped eg. 'glasses' or 'compound'.
     */  "name": "service", 
    
      "min": "0", 
      "max": "1", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    { 
    /*Item typification or modifiers codes, eg for Oral whether the treatment is cosmetic or associated with TMJ, or for medical whether the treatment was outside the clinic or out of office hours.
     */  "name": "modifier", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    { 
    /*For programs which require reason codes for the inclusion or covering of this billed item under the program or sub-program.
     */  "name": "programCode", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    [ /* Choice */ 
    /*The date or dates when the enclosed suite of services were performed or completed.
     */
        {   "name": "servicedDate", 
        
          "min": "1", 
          "max": "1", 
          "type": "date",
          "isPrimitive": true }, 
        {   "name": "servicedPeriod", 
        
          "min": "1", 
          "max": "1", 
          "type": "Period",
          "isPrimitive": false }, 
    ], 
    [ /* Choice */ 
    /*Where the service was provided.
     */
        {   "name": "locationCodeableConcept", 
        
          "min": "1", 
          "max": "1", 
          "type": "CodeableConcept",
          "isPrimitive": false }, 
        {   "name": "locationAddress", 
        
          "min": "1", 
          "max": "1", 
          "type": "Address",
          "isPrimitive": false }, 
        {   "name": "locationReference", 
        
          "min": "1", 
          "max": "1", 
          "type": "Reference",
          "isPrimitive": false }, 
    ], 
    { 
    /*The number of repetitions of a service or product.
     */  "name": "quantity", 
    
      "min": "0", 
      "max": "1", 
      "type": "Quantity",
      "isPrimitive": false }, 
    { 
    /*If the item is a node then this is the fee for the product or service, otherwise this is the total of the fees for the children of the group.
     */  "name": "unitPrice", 
    
      "min": "0", 
      "max": "1", 
      "type": "Money",
      "isPrimitive": false }, 
    { 
    /*A real number that represents a multiplier used in determining the overall value of services delivered and/or goods received. The concept of a Factor allows for a discount or surcharge multiplier to be applied to a monetary amount.
     */  "name": "factor", 
    
      "min": "0", 
      "max": "1", 
      "type": "decimal",
      "isPrimitive": true }, 
    { 
    /*The quantity times the unit price for an addittional service or product or charge. For example, the formula: unit Quantity * unit Price (Cost per Point) * factor Number  * points = net Amount. Quantity, factor and points are assumed to be 1 if not supplied.
     */  "name": "net", 
    
      "min": "0", 
      "max": "1", 
      "type": "Money",
      "isPrimitive": false }, 
    { 
    /*List of Unique Device Identifiers associated with this line item.
     */  "name": "udi", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "Reference",
      "isPrimitive": false }, 
    { 
    /*Physical service site on the patient (limb, tooth, etc.).
     */  "name": "bodySite", 
    
      "min": "0", 
      "max": "1", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    { 
    /*A region or surface of the site, eg. limb region or tooth surface(s).
     */  "name": "subSite", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "CodeableConcept",
      "isPrimitive": false }, 
    { 
    /*A billed item may include goods or services provided in multiple encounters.
     */  "name": "encounter", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "Reference",
      "isPrimitive": false }, 
    { 
    /*Second tier of goods and services.
     */  "name": "detail", 
    
      "min": "0", 
      "max": "unbounded", 
      "type": "Claim.Detail",
      "isPrimitive": false }, 
  ]
},
